class App extends React.Component { 
  constructor() { 
      super() 
      this.state = { 
          count: 0 
      } 
      this.handleClick = this.handleClick.bind(this)
  } 
  render() { 
    function handleClick() {
      this.setState({ count: 1 })
    }
      return ( 
          <div> 
              <h1>{this.state.count}</h1> 
              <button onClick={this.state.handleClick}>Change!</button> 
          </div> 
      ) 
  } 
} 

export default App
